import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import { NavLink } from 'react-router-dom';
import Navbar from 'react-bootstrap/Navbar';
import logo from '../assets/logo.svg';

export default function NavScrollExample() {
  return (
    <Navbar expand="md" className="bg-body-tertiary p-0">
      <Container fluid>
        <Navbar.Brand href="/">
            <img
                src={logo}
                alt="Logo"
                width="160"
                height="80"
                className="d-inline-block align-top"
            />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="ms-auto my-2 my-md-0"
            style={{ maxHeight: '120px' }}
            navbarScroll
          >
            <Nav.Link href="/" className="mx-3">Inicio</Nav.Link>
            <Nav.Link href="/servicios" className="mx-3">Servicios</Nav.Link>            
            <Nav.Link href="/contacto"  className="mx-3">
              Contacto
            </Nav.Link>
          </Nav>
          
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}
